import React from "react";
import Header from "../components/Header";
import Content from "../components/Content";
import logo from '../assets/logo.png';

function Main() {
  return (
    <div style={{ display: 'flex', height: '100vh' }}>
      <div style={{ width: '50%', padding: '20px' }}>
        <Content image={logo} title="콘텐츠 1" description="설명 1" />
        <Content image={logo} title="콘텐츠 2" description="설명 2" />
        <Content image={logo} title="콘텐츠 3" description="설명 3" />
        <Content image={logo} title="콘텐츠 4" description="설명 4" />
      </div>
      <div style={{ width: '50%' }}>
        {/* 오른쪽은 향후에 무언가를 넣거나 비워둠 */}
      </div>
    </div>

    
  );
}

export default Main;
